            <div className="row">
                <div className="col-lg-6 col-sm-12 col-md-12 order-1">
              
                </div>
                <div className="col-lg-6 col-sm-12 col-md-12 order-2">

                </div>
            </div>
        </div>
      </section>
    </>
  );
};

export default Home;
